import styled from 'styled-components';

const StyledSectionButton = styled.button`
    background : #73e8ff;
    color: rgba($color: #000000, $alpha: 0.5);


    &:hover {
        background-color : #29b6f6;
        border : 1px solid black;
        color: white;
    }
`

export default StyledSectionButton;
